import React from "react";
import UserPhoto from "./User photo/UserPhoto";
import './StyleCenter.css'

const Center = () =>{
    return <div className="styleOfCenter">
           <UserPhoto></UserPhoto>
            <button>Edit</button>
    </div>
}

export default Center;
